import styled from "styled-components";
import image from '../images/coffeeImage/image.jpg'


export const HomeCollectionPlant = styled.div`
background: linear-gradient(to right, rgba(0,0,0,0), rgba(0,0,0,0)), url(${image});
  height: 70vh;
  display: flex;
  justify-content: space-between;
  padding: 0.2rem calc((100vw - 1000px) / 2);
  z-index: 12;
  width: 100%;
`
